import axios from "axios";
import ConstantList from "../../appConfig";
const API_PATH=ConstantList.API_ENPOINT+"/api/technician";
const API_PATH_Qualification=ConstantList.API_ENPOINT+"/api/qualification";
const API_PATH_HealthOrg=ConstantList.API_ENPOINT+"/api/HealthOrg";
export const getAll = () => {
  return axios.get(API_PATH);  
};
export const searchByPage = (searchObject) => {
  var url = API_PATH+"/searchByDto";
  return axios.post(url,searchObject);  
};

export const getItemById = id => {
  var url = API_PATH+"/getById/"+id;
  return axios.get(url);
};
export const deleteItem = id => {
  var url = API_PATH+"/"+id;
  return axios.delete(url);
};
export const saveItem = item => {
  var url = API_PATH;
  if (item.id) {
    return axios.put(url+"/"+item.id, item);
  }
  return axios.post(url, item);
};

export const getAllQualification = () => {
  var url = API_PATH_Qualification+"/getAll";
  return axios.get(url);  
};

export const getAllHealthOrg = () => {
  var url = API_PATH_HealthOrg+"/getAll";
  return axios.get(url);  
};
